import React from 'react'

function Header() {
    return (
        <div>
            <nav className="navbar navbar-light" 
            style= {{
                backgroundColor: "#ffffff"
            }}>
            <a className="text-aligh-left" href="/" style={{
                color: "#6d98ba",
                paddingLeft: "15px"
            }}>Error and Log Management</a>
            <i className="fas fa-user-circle"></i>
            <a className="text-align-right" href="/Profile">Aministrator</a>

        </nav>

        </div>
    )
}
export default Header;
